style.css:
body::before {
    content: "";
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: -1;
    background: url("https://img.youtube.com/vi/EBnDivDzisY/maxresdefault.jpg") center/cover no-repeat;
    opacity: 0.5;
}

/* Optional: Add overlay styles */
body::after {
    content: "";
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: rgba(0, 0, 0, 0.5);
    z-index: -1;
}
